import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import ReactPlayer from 'react-player'
import juliasession from './videos/julia_session_nv.mp4'
import nancysession from './videos/nancy_session_nv.mp4'
import audio from './videos/discussion_nv.m4a'
import Fab from '@material-ui/core/Fab';
import RoomIcon from '@material-ui/icons/Room';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import { Typography } from '@material-ui/core';

const useStyles = makeStyles({
  root: {
    display: 'flex',
    alignItems: 'center',
  },
});

export default function Call () {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <Grid
      container
      direction="row"
      justify="center"
      alignItems="flex-start"
      >
        <Grid item xs={3}></Grid>
          <Paper>
        <ReactPlayer
        playing='true'
        muted
        url= {juliasession}
        />
        <Typography variant='caption'>Julia</Typography>
        </Paper>
        <Fab color="primary" aria-label="add">
          <RoomIcon />
          </Fab>
          <Grid item xs={4}>
        <ReactPlayer
        playing='true'
        muted
        url= {nancysession}
        width='10%'
        height='10%'
        />
        <Typography variant='caption'>Nancy</Typography>
        </Grid>
        </Grid>

    </div>
  )}
